def monotonic(l: list):
    increasing = decreasing = True
    for i in range(1, len(l)):
        if l[i] > l[i - 1]:
            decreasing = False
        elif l[i] < l[i - 1]:
            increasing = False
    return increasing or decreasing

def pluck(arr):
    smallest_even = float('inf')
    smallest_index = -1
    for i, value in enumerate(arr):
        if value % 2 == 0 and value < smallest_even:
            smallest_even = value
            smallest_index = i
    return [smallest_even, smallest_index] if smallest_even != float('inf') else []

