def get_odd_collatz(n):
    def collatz(n):
        if n == 1:
            return [1]
        elif n % 2 == 0:
            return collatz(n // 2) + [n]
        else:
            return collatz(3 * n + 1) + [n]
    return sorted([num for num in collatz(n) if num % 2 != 0])

