def split_words(txt):
    """
    Given a string of words, return a list of words split on whitespace, if no whitespaces exists in the text you
    should split on commas ',' if no commas exists you should return the number of lower-case letters with odd order in the
    alphabet, ord('a') = 0, ord('b') = 1, ... ord('z') = 25
    Examples
    split_words("Hello world!") ➞ ["Hello", "world!"]
    split_words("Hello,world!") ➞ ["Hello", "world!"]
    split_words("abcdef") == 3 
    """
    if ' ' in txt:
        return txt.split()
    elif ',' in txt:
        return txt.split(',')
    else:
        return sum(1 for char in txt if char.islower() and (ord(char) - ord('a')) % 2 == 0) - 1

def prod_signs(arr):
    if not arr:
        return None
    sign_product = 1
    for num in arr:
        if num == 0:
            return 0
        sign_product *= num if num > 0 else -1
    return sum(abs(num) * sign_product for num in arr)

def minPath(grid, k):
    def dfs(x, y, path, steps):
        if steps == k:
            return path
        for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(grid) and 0 <= ny < len(grid[0]):
                dfs(nx, ny, path + [grid[nx][ny]], steps + 1)
    return dfs(0, 0, [grid[0][0]], 1)

